function parseConstraints() {
    var constraintString = this.get("constraintsTextField").getTextString();
    var constraints = constraintString.split("\n");
    this.get("variablesTextField").setTextString("");
    this.constraintsArray = new Array();

    for (var i = 0; i < constraints.length; i++) {
        var line = constraints[i].trim();
        if (line != "" && line.indexOf("//") != 0 && line.indexOf(")") >= 0) {
            var prior = this.get("variablesTextField").getTextString();

            var base = constraints[i].split(")")[0];
            var parts = base.split("(");
            var methodName = parts[0];
            var variables = parts[1].split(",");   

            for (var j = 0; j < variables.length; j++) {
                variables[j] = variables[j].trim();
            }

            this.constraintsArray[i] = new Array(methodName, variables);

            switch (methodName) {
                case "height":
                    this.height(variables);
                    break;
                case "width":
                    this.width(variables);
                    break;
                case "ratio":
                    this.ratio(variables);
                    break;
                case "position":
                    this.position(variables);
                    break;
                case "x":
                    this.x(variables);
                    break;
                case "y":
                    this.y(variables);
                    break;
                case "vertical_distance":
                    this.verticalDistance(variables);
                    break;
                case "horizontal_distance":
                    this.horizontalDistance(variables);
                    break;
                default:
                    break;
            }
        }
    }

    //add needed values not described by constraints
    console.log("needed values: " + this.neededValues);
    console.log("specified values: " + this.specifiedValues);
    for (var i = 0; i < this.neededValues.length; i++) {
        var foundValues = new Array();
        var elementCount = this.neededValues[i][0].length;
        for (var j = 0; j < this.neededValues[i].length; j++) {
                var found = 0.0;
                for (var k = 0; k < this.neededValues[i][j].length; k++) {
                    for (var l = 0; l < this.specifiedValues.length; l++) {
                        if (this.neededValues[i][j][k] == 
                                this.specifiedValues[l])
                            found = found + 1.0;
                    }
                }
                foundValues.push(found / elementCount);
        }
        var max = 0.0;
        var maxIndex = 0;
        for (var m = 0; m < foundValues.length; m++) {
            if (foundValues[m] > max) {
                max = foundValues[m];
                maxIndex = m;
            }
        }
        if (max < 1.0) {            
            for (var j = 0; j < this.neededValues[i][maxIndex].length; j++) {
                var toBeAdded = this.neededValues[i][maxIndex][j];
                var alreadySpecified = false;
                for (var l = 0; l < this.specifiedValues.length; l++) {
                    if (toBeAdded == this.specifiedValues[l]) {
                        alreadySpecified = true;
                        break;
                    }
                }
                if (!alreadySpecified) {
                    console.log("we need to add " + toBeAdded);
                    var parts = toBeAdded.split(".");
                    var name = parts[0];
                    var methodName = parts[1];
                    switch (methodName) {
                        case "h":
                            this.height(new Array(name, this.getValue(toBeAdded)));
                            break;
                        case "w":
                            this.width(new Array(name, this.getValue(toBeAdded)));
                            break;
                        case "x":
                            this.x(new Array(name, this.getValue(toBeAdded)));
                            break;
                        case "y":
                            this.y(new Array(name, this.getValue(toBeAdded)));
                            break;
                        default:
                            break;
                    }
                }
            }
        }
    }
}

