function addConstraintArray(variables, sum) {
    var length = this.algorithm.tableau[0].length;

    var helper = new Array();
    for (var i = 0; i < length; i++) {
        helper[i] = 0;
    }

    var maxFunct = this.algorithm.tableau.pop();

    for (var i = 0; i < variables.length; i++) {
