        case "x":
            return this.get(name1).getPosition().x;
        case "y":
            return this.get(name1).getPosition().y;
        case "ratio":
            return this.getValue(name1) / this.getValue(name2);
        case "vertical_distance":
            return Math.abs(this.get(name1).getPosition().x 
                + this.get(name1).getExtent().y - this.get(name2).getPosition().x);
        case "horizontal_distance":
            return Math.abs(this.get(name1).getPosition().y 
                + this.get(name1).getExtent().x - this.get(name2).getPosition().y)
        default:
            return "?"
    }
}

