    this.get("SelectedText").setTextString(name);
    if(this.currentConstraintType != null){
        if(this.currentConstraintType == "height" || this.currentConstraintType == "width"){
            var value = this.getValueForConstraintType(this.currentConstraintType, name);
            this.addConstraint(this.currentConstraintType, name, value);
        } else if(this.currentConstraintType == "ratio"){
            if (this.firstRatioSide == null) {
                this.firstRatioSide = this.getRatioSide(name, part);
            } else {
                this.addRatioConstraint(this.currentConstraintType, 
                    this.firstRatioSide, this.getRatioSide(name, part), 1);
            }
        } else if(this.currentConstraintType == "position"){
            if (part == "L") {
                var value = this.getValueForConstraintType("x", name);
                this.addConstraint(this.currentConstraintType, name + ".x", value);
            }
            else if (part == "T") {
                var value = this.getValueForConstraintType("y", name);
                this.addConstraint(this.currentConstraintType, name + ".y", value);
            } else {
                var value = this.getValueForConstraintType(
                    this.currentConstraintType, name);
            this.addConstraint(this.currentConstraintType, name, value);
            }
        } else if(this.currentConstraintType == "vertical_distance"){
            if (this.firstVerticalDistance == null) {
                this.firstVerticalDistance = name;
            } else {
                var value = this.getValueForConstraintType("vertical_distance", this.firstVerticalDistance, name);
                this.addDistanceConstraint(this.currentConstraintType, 
