function printTableau() {
    this.get("tableauTextField").setTextString("");
    var textString = "Variablen: " + this.algorithm.all + "\n";
    textString += "Gesucht: " + this.algorithm.needed + "\n";
    textString += "Schlupfvariablen: " + this.algorithm.schlupf + "\n\n";
    textString += "Results: " + this.algorithm.resultArray + "\n\n";

    var title = this.length("");
    for (var i = 0; i < this.algorithm.all.length; i++) {
        title += this.length(this.algorithm.all[i]);
    }
    textString += title + "\n";

    var negativeFValuesIndices = new Array();
    var minFValueIndex = 0;
    var lastLineStart = 0;

    for (var i = 0; i < this.algorithm.tableau.length; i++) {
         var line = "";
         if (i < this.algorithm.schlupf.length) {
              line = this.length(this.algorithm.schlupf[i]);
         } else {
             line = this.length("F");
             lastLineStart = textString.length;
         }

        for (var j = 0; j < this.algorithm.tableau[0].length; j++) {

            line += this.length("" 
                + (Math.round(this.algorithm.tableau[i][j] * 100) / 100));
            var startIndex = textString.length + line.length 
                - new String(Math.round(this.algorithm.tableau[i][j] * 100) 
                / 100).length;
            if (i == this.algorithm.tableau.length - 1 
                    && this.algorithm.tableau[i][j] < 0) {
                negativeFValuesIndices.push(
                    new Array(startIndex, textString.length + line.length)) ;
                if (this.algorithm.tableau[i][j] 
                        < this.algorithm.tableau[i][minFValueIndex])
                    minFValueIndex = negativeFValuesIndices.length-1;
            }
        }
        textString += line + "\n";
    }

    this.get("tableauTextField").setTextString(textString);

    this.get("tableauTextField").emphasize(
        {color: 'blue'}, lastLineStart, textString.length);

    for (var i = 0; i < negativeFValuesIndices.length; i++)
    {
        var start = negativeFValuesIndices[i][0];
        var end = negativeFValuesIndices[i][1];
        this.get("tableauTextField").emphasize({color: 'red'}, start, end);
        if (i == minFValueIndex) {
            this.get("tableauTextField").emphasize(
                {textDecoration: 'underline'},start,end);
        }
    }
}

